import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import ptw from './components/context/PtwContext';
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <>
    <ptw.consumer>
      <App />
    </ptw.consumer>
  </>
);
